function SendEvent(type, name, parameter) {

	if (debug) {
		console.log(name + " = " + parameter);
		return;
	}
	WebUI.Call(type, name, parameter)
}

function Init() {
	InitTables();
	blueprintArray = {};
	entityArray = {}
}

function RegisterInstances(p_Instances) {

	blueprintArray = JSON.parse(p_Instances);

	var blueprints = [];
	Object.keys(blueprintArray).forEach(function (key) {
		var blueprint = blueprintArray[key];
		blueprints[key] = new Blueprint(blueprint.partitionGuid, blueprint.instanceGuid, blueprint.name, blueprint.variations);
	});
	$('#treeView').find('.content').append(new TreeView(blueprints).tree);
}


function InitTables() {

	entityTable = $('#entity_list').DataTable({
		select: true
	});

	$('#entity_list').find('tbody').on('click', 'tr', function () {

		let data = entityTable.row(this).data();
		let id = data[0];
		console.log(id);

		if (selectedEntityID === id) {
			//unselect

			selectedEntityID = -1;

			$(this).removeClass("selectedItem");

			SendEvent('DispatchEventLocal', 'MapEditor:DeselectEntity', id)
		} else {
			//select
			selectedEntityID = id;

			// This will make sure we get the correct gizmo mode if the previous mode was "select".
			renderer.SetGizmoMode(control.control.getMode());

			$(".selectedItem").removeClass("selectedItem");

			$(this).addClass("selectedItem");

			SendEvent('DispatchEventLocal', 'MapEditor:SelectEntity', id)
		}
	});
}

function PrepareInstanceSpawn(p_InstanceGuid) {
	let instance = blueprintArray[p_InstanceGuid];
	let instanceGuid = instance.instanceGuid;
	let partitionGuid = instance.partitionGuid;
	let variations = instance.variations;

	//Check if we have any variations for the object
	if (variations.length == null) {
		// There are no variations, let's set it to -1 so the engine will know we're missing it.
		variations = [-1]
	}


	//Check if we've previously spawned this object.
	if (confirmedInstances[instanceGuid] != null) {
		SpawnInstance(partitionGuid, instanceGuid, variations[0]);
	} else {
		dangerousInstance = {
			"instanceGuid": instanceGuid,
			"partitionGuid": partitionGuid,
			"variation": -1
		};
		console.log("Unknown variation!");
		// Bring up warning dialog.
		ui.dialogs["variation"].dialog("open");
	}
}

function ConfirmInstanceSpawn() {
	SpawnInstance(dangerousInstance.partitionGuid, dangerousInstance.instanceGuid, dangerousInstance.variation);
	confirmedInstances[dangerousInstance.instanceGuid] = true;

	ui.dialogs["variation"].dialog("close");
}

function SpawnInstance(p_PartitionGuid, p_InstanceGuid, p_Variation) {
	console.log(p_PartitionGuid + " | " + p_InstanceGuid + " | " + p_Variation);
	SendEvent('DispatchEventLocal', 'MapEditor:SpawnInstance', p_PartitionGuid + ":" + p_InstanceGuid + ":" + p_Variation)
}

